function initFileUploads() {
	console.log('call initFileUploads()');

	// Change this to the location of your server-side upload handler:
	var url = appBaseUrl +'files/upload',
		uploadButton = $('<button/>')
			.addClass('btn btn-primary')
			.prop('disabled', true)
			.text('Processing...')
			.on('click', function () {
				var $this = $(this),
					data = $this.data();

				$this
					.off('click')
					.text('Abort')
					.on('click', function () {
						$this.remove();
						data.abort();
					});

				data.submit().always(function () {
					$this.remove();
				});
			});

		$('#fileupload').fileupload({
			url: url,
			dataType: 'json',
			autoUpload: true,
			acceptFileTypes: /(\.|\/)(gif|jpe?g|png)$/i,
			maxFileSize: 9999000,
			// Enable image resizing, except for Android and Opera,
			// which actually support image resizing, but fail to
			// send Blob objects via XHR requests:
			disableImageResize: /Android(?!.*Chrome)|Opera/.test(window.navigator.userAgent),
			previewMaxWidth: 100,
			previewMaxHeight: 100,
			previewCrop: true
		})
		//.on('fileuploadadd', function (e, data) {
         //   console.log('fileuploadadd: dodano plik');
		//})
		.on('fileuploadprocessalways', function (e, data) {
            console.log('fileuploadprocessalways');
		})
        .on('fileuploadprogressall', function (e, data) {
            console.log('fileuploadprogressall');

			var progress = parseInt(data.loaded / data.total * 100, 10);
			$('#progress .progress-bar').css('width', progress +'%');
		})
        .on('fileuploaddone', function (e, data) {
            console.log('fileuploaddone');

			$.each(data.result.files, function (index, file) {
                //$('#attachments-list').append( tmpl('tpl-uploaded-files', data.files) );
                $('#attachments-list').append( file.html );
			});

            initJStriggers();
		})
        .on('fileuploadfail', function (e, data) {
                console.log('fileuploadfail');
		})
        .prop('disabled', !$.support.fileInput)
		.parent().addClass($.support.fileInput ? undefined : 'disabled');

}

function initLaravel() {
	/*
	 <a href="posts/2" data-method="delete"> <---- We want to send an HTTP DELETE request
	 - Or, request confirmation in the process -
	 <a href="posts/2" data-method="delete" data-confirm="Are you sure?">
	 */

	(function() {

		var laravel = {
			initialize: function() {
				this.methodLinks = $('a[data-method]');

				this.registerEvents();
			},

			registerEvents: function() {
				this.methodLinks.on('click', this.handleMethod);
			},

			handleMethod: function(e) {
				var link = $(this);
				var httpMethod = link.data('method').toUpperCase();
				var form;

				// If the data-method attribute is not PUT or DELETE,
				// then we don't know what to do. Just ignore.
				if ( $.inArray(httpMethod, ['PUT', 'DELETE']) === - 1 ) {
					return;
				}

				// Allow user to optionally provide data-confirm="Are you sure?"
				if ( link.data('confirm') ) {
					if ( ! laravel.verifyConfirm(link) ) {
						return false;
					}
				}

				form = laravel.createForm(link);
				form.submit();

				e.preventDefault();
			},

			verifyConfirm: function(link) {
				return confirm(link.data('confirm'));
			},

			createForm: function(link) {
				var form =
					$('<form>', {
						'method': 'POST',
						'action': link.attr('href')
					});

				var token =
					$('<input>', {
						'type': 'hidden',
						'name': 'csrf_token',
						'value': '<?php echo csrf_token(); ?>' // hmmmm...
					});

				var hiddenInput =
					$('<input>', {
						'name': '_method',
						'type': 'hidden',
						'value': link.data('method')
					});

				return form.append(token, hiddenInput)
					.appendTo('body');
			}
		};

		laravel.initialize();

	})();
}

